import React, { Component } from 'react';
import { exportDefaultDeclaration } from '@babel/types';

class Landing extends Component {
    render() {
        return(
            <div style={{width: '100', margin: 'auto'}}>
                <Grid classNme="landing-grid">
                    <Cell col="{12}"></Cell>
                </Grid>
            </div>
        )
    }
}

export default Landing;
